import  React  from "react";
import { useState } from "react"


function Login(){
  const [form,setForm]=useState({})
  const handleForm = (e)=>{
      setForm({...form,
        [e.target.name] : e.target.value
      })
  }

  const handleSubmit =async (e)=>{
    e.preventDefault();
    const response=await fetch("http://localhost:5000/login",{
      method: ""
    })

  }
  return(
    <div>
      <form onSubmit={handleSubmit}>
      <h1>Login Page</h1>
      <input placeholder="Enter Name" type="text" name="username" onChange={handleForm}></input>
      <input type="password" placeholder="Enter Password" name="password" onChange={handleForm}></input>
      <input type="button"> </input>
      </form>
    </div>
  )
}
